import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "./Routes/Home";


function App() {
  return (
    <div className="App">

      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Home />}>
          <Route index element={<Home />}/>
<> </>
          </Route>
        </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
